pragma solidity 0.4.19;

import "../store/ExternalStorage.sol";

contract StorageContractOwnerMock {
  ExternalStorage public store;

  function StorageContractOwnerMock() public {
    store = new ExternalStorage();
    store.setBool(keccak256("contract.storage.initialised"), true);
  }

  function getAddress(string _key) external constant returns (address) {
      return store.getAddress(keccak256(_key));
  }
  /// @param _key The key for the record
  function getUint(string _key) external constant returns (uint) {
      return store.getUint(keccak256(_key));
  }

  /// @param _key The key for the record
  function getBool(string _key) external constant returns (bool) {
      return store.getBool(keccak256(_key));
  }

  /// @param _key The key for the record
  function getInt(string _key) external constant returns (int) {
      return store.getInt(keccak256(_key));
  }

  function getBytes(string _key) external constant returns (bytes32) {
      return store.getBytes(keccak256(_key));
  }

  /// @param _key The key for the record
  function setAddress(string _key, address _value) public {
      store.setAddress(keccak256(_key), _value);
  }

  /// @param _key The key for the record
  function setUint(string _key, uint _value) public {
      store.setUint(keccak256(_key), _value);
  }

  /// @param _key The key for the record
  function setBuffer(string _key, bytes _value) public {
      store.setBuffer(keccak256(_key), _value);
  }

  function setBytes(string _key, bytes32 _value) public {
      store.setBytes(keccak256(_key), _value);
  }

  function setString(string _key, string _value) public {
      store.setString(keccak256(_key), _value);
  }

  /// @param _key The key for the record
  function setBool(string _key, bool _value) public {
      store.setBool(keccak256(_key), _value);
  }

  /// @param _key The key for the record
  function setInt(string _key, int _value) public {
      store.setInt(keccak256(_key), _value);
  }
}
